import React from 'react';

function List(props){

    console.log(props.onItemDeleted)
    return(

        <ul>

            {props.items.map(item =>    <li key={item.id}>
                                            {item.text}
                                            <button onClick={()=> props.onItemDeleted(item) }>Apagar</button>
                                        </li>)}

        </ul>

    );

};

export default List;
